ingredients_text:
Brot: Dinkelmehl (eine Weizenart), Wasser, Sonnenblumenkerne, Dinkelkaramellmalzmehl, Dinkelvollkornsauerteig (Dinkelvollkornmehl), Dinkelmalzextrakt, Gerstenmalzextrakt, Leinsaat, Hefe, Salz, Zucker, Dextrose, Verdickungsmittel: Guarkernmehl; 
Kräuter-Crème 20 %: Rapsöl, Zwiebeln, Kräuter (Petersilie, Rosmarin, Dill), Knoblauch, Salz, Stärke, modifizierte Stärke, Zitronensaftkonzentrat, Gewürze, Gewürzextrakt, natürliches Knoblaucharoma. 

Das Produkt kann Spuren von Milch und Sesam enthalten.
